import React from 'react'
import "./AllRestaurants.scss";
import BeigeCard from "../layout/card/BeigeCard";

const RestaurantsGrid:React.FC<{items: object[]}> = (props) => {
  return (
    <div className="restaurants-grid">
          {props.items.map((item) => {return (<BeigeCard
          key={item.key} img={item.chefImage} title={item.restaurantName} detail={'fff'}
        >{item}</BeigeCard>)})}

    </div>
  )
}

export default RestaurantsGrid;
